import React from 'react';
import styled from 'styled-components';

const Table = styled.table`
  display: flex;
  margin: 20px;
`;
const Row = styled.tr`
  display: flex;
`;

const Cell = styled.td`
  display: flex;
`;

const ActionItems = () => {

    return (
        <Table>
            <thead>
                <Cell>Date</Cell>
                <Cell>Author</Cell>
                <Cell>Assigned To</Cell>
                <Cell>Description</Cell>
            </thead>
        </Table>
    )

}

export default ActionItems;
